text:
@mhsexpert speaking on if the #metoo movement has lost its meaning? i personally feel it has been fixated on high drama rather than looking at an issue and seeing what solutions can be created?
_______________________________
we have to shift the narrative that it’s a gender war, that it’s anti-male and that it’s men vs. women, and that it’s only for a certain type of person. the focus should be shifted back to the survivors because it will make a difference in the number of sexual assaults we’ll see moving forward. we’ll be discussing topics like this and more at the next #mindovermatterlive on saturday, march 23 starring @mhsexpert and @sirrobertpoe.

