“i was scared of my husband, he often threatened to kill me,” said rakeyia, sharing memories from the five years of domestic abuse she suffered inside her two-room concrete house. “my husband would slap me and then beat my body when i asked for money for housekeeping or to take care of the children.” now her life is no longer dominated by fear. her village is one of 20 rural communities in ghana which have piloted depament for international development community based action teams (combat). and so far, it appears to be working: women in paicipating villages have repoed a 50 per cent reduction in physical paner violence over 18 months.

